package com.readsense.app.model;

import java.util.List;

public class DetectCondition {

    /**
     * CameraID : test
     * LargeImg : 
     * SmallImg : [""]
     * PeopleCount : 3
     * PhotoDate : 636651782593855073
     * Pnm : 1
     */

    private String CameraID;
    private String LargeImg;
    private int PeopleCount;
    private long PhotoDate;
    private int Pnm;
    private List<String> SmallImg;

    public DetectCondition(String cameraID, String largeImg, int peopleCount, long photoDate, int pnm, List<String> smallImg) {
        CameraID = cameraID;
        LargeImg = largeImg;
        PeopleCount = peopleCount;
        PhotoDate = photoDate;
        Pnm = pnm;
        SmallImg = smallImg;
    }

    public String getCameraID() {
        return CameraID;
    }

    public void setCameraID(String CameraID) {
        this.CameraID = CameraID;
    }

    public String getLargeImg() {
        return LargeImg;
    }

    public void setLargeImg(String LargeImg) {
        this.LargeImg = LargeImg;
    }

    public int getPeopleCount() {
        return PeopleCount;
    }

    public void setPeopleCount(int PeopleCount) {
        this.PeopleCount = PeopleCount;
    }

    public long getPhotoDate() {
        return PhotoDate;
    }

    public void setPhotoDate(long PhotoDate) {
        this.PhotoDate = PhotoDate;
    }

    public int getPnm() {
        return Pnm;
    }

    public void setPnm(int Pnm) {
        this.Pnm = Pnm;
    }

    public List<String> getSmallImg() {
        return SmallImg;
    }

    public void setSmallImg(List<String> SmallImg) {
        this.SmallImg = SmallImg;
    }
}
